import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';

import { Link, Routes, Route, useNavigate } from 'react-router-dom';


const QuizFP = () => {
    return ( 
        <div className="q-second-page">
            <Container display="flex">
                {/*The progress bar goes here*/}
                <div className="prog-bar">
                </div>

                {/*Form start*/}
                <Form>
                    <Form.Group className="mb-3"controlId="form.Name">
                        <Form.Label>Name</Form.Label>
                        <Form.Control type="text" placeholder="Enter name" />
                    </Form.Group>

                    <Form.Group controlId="form.Email">
                        <Form.Label>Email address</Form.Label>
                        <Form.Control type="email" placeholder="name@example.com" />
                    </Form.Group>

                    <Form.Group controlId="form.Textarea">
                        <Form.Label>Comment</Form.Label>
                        <Form.Control as="textarea" rows={3} />
                    </Form.Group>

                </Form>
                {/*Form End*/}

                {/*Back/Next btns*/}
                <div className="row">
                    <div className="col-lg-6">
                        <Link to="/questions" className="btn btn-secondary text-center fw-bold"> Back </Link>
                    </div>
                    <div className="col-lg-6">
                        <Link to="/questions" className="btn btn-primary text-center fw-bold"> Next </Link>
                    </div>
                </div>
            </Container>
        </div>


     );
}

export default QuizFP;
